import React from 'react';
import './Title.css';

class Title extends React.Component {
	render(){
		return (
			<div className="row">
				<div className="col-md-6 offset-md-3 section-title">
					<h2 className="section-header"><span>New</span> Arrivals</h2>
					<p>{this.props.text}</p>
				</div>
			</div>
		);
	}
}

export default Title;
